        ];

        skinShapes.forEach((element, index, array) => {
            return new Promise((resolve, reject) => {
                const img = new Image();
                img.onload = () => resolve(img);
                img.onerror = () => reject(new Error(`Failed to load: ${element}`));
                img.src = element;
            });
        });

        const canvas = document.getElementById("canvas");
        const ctx = canvas.getContext("2d");
        //make circle
        ctx.beginPath();
        ctx.arc(canvas.width/2, canvas.height/2, 150, 0, Math.PI * 2);
        ctx.clip();
        //background
        //canvas.style.background = "#"+exampleSkinObj.bc.toString(16);
        ctx.fillStyle = "#"+exampleSkinObj.bc.toString(16);
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        function draw(bX, bY, id, colour, flipX, flipY, angle, scale) {
            const image = new Image();
            image.src = skinShapes[id-1];
            
            //I should recalibrate scale
            scale*= 10;
            image.width = image.width*scale;
            image.height = image.height*scale;
            
            let cX = 0-image.width/2+10*bX+150;
            let cY = 0-image.height/2+10*bY+150;
            
            //initialise fake canvas
            const offscreenCanvas = document.getElementById("can2");
            const offCtx = can2.getContext("2d");
            offscreenCanvas.height=canvas.height;
            offscreenCanvas.width=canvas.width;

            //rotate and flip and draw on fake canvas
            offCtx.translate(cX+image.width/2, cY+image.height/2);
            offCtx.rotate(angle * (Math.PI / 180));
            if(flipX == true){
                offCtx.scale(-1,1);
            }
            if(flipY == true){
                offCtx.scale(1,-1);
            }

            offCtx.drawImage(image, 0-image.width/2, 0-image.height/2, image.width, image.height);

            
            //colour via mask on fake canvas
            offCtx.globalCompositeOperation = 'source-in';
            offCtx.fillStyle = "#"+colour.toString(16);
            offCtx.fillRect(0-image.width/2, 0-image.height/2, image.width, image.height);
            offCtx.globalCompositeOperation = 'source-over';

            
            //
            //offCtx.translate(image.width/2, image.height/2);
            //offCtx.rotate(angle * (Math.PI / 180));

            //draw at pos
            ctx.drawImage(offscreenCanvas, 0, 0);

            };
            skin.slice().reverse().forEach(elem => draw(elem.x, elem.y, elem.id, elem.color, elem.flipX, elem.flipY, elem.angle, elem.scale));
    </script>
